    }
  return (
    <div className="login">
      <h2>Sign up</h2>
      <hr />

      <div className="signup-form">
          <input type="text" className="inputBox" 
            onChange={(e)=>setEmail(e.target.value)} value={email}          
          />


          <input type="password" className="inputBox" 
